<?php

namespace App\Tests\Controller;

use Symfony\Bundle\FrameworkBundle\Test\WebTestCase;
use Symfony\Component\HttpFoundation\Response;

class CoreControllerTest extends WebTestCase
{

  private $client = null;
  private $start_time = 0.0;
  private $end_time = 0.0;

  private $credentials = [
    'ROLE_SUPER_ADMIN'=>['email'=>'pablo.salgado@rai.usc.es','password'=>'abc123'],
    'ROLE_CRM'=>['email'=>'crm@galierp.gal','password'=>'abc123'],
    'ROLE_FISCAL'=>['email'=>'fiscal@galierp.gal','password'=>'abc123']
  ];

  public function setUp()
  {
      $this->client = static::createClient();
  }

  private function logIn($role)
  {
    $crawler = $this->client->request('GET','/gl/login');
    $form = $crawler->filter('.user')->form();
    $form['email']=$this->credentials[$role]['email'];
    $form['password']=$this->credentials[$role]['password'];
    $crawler = $this->client->submit($form);
  }

  private function logOut()
  {
    $this->client->request('GET','/gl/logout');
  }

  public function testListaClientes()
  {
    $this->logIn("ROLE_SUPER_ADMIN");
    $crawler = $this->client->request('GET','/gl/clientes');
    $this->assertSame(Response::HTTP_OK, $this->client->getResponse()->getStatusCode());
    $this->assertContains('Lista de clientes', $crawler->filter('h1')->text());
  }

  public function testListaUsuarios()
  {
    $this->logIn("ROLE_SUPER_ADMIN");
    $crawler = $this->client->request('GET','/gl/usuarios');
    $this->assertSame(Response::HTTP_OK, $this->client->getResponse()->getStatusCode());
    $this->assertContains('Lista de usuarios', $crawler->filter('h1')->text());
  }

  public function testAltaNuevoUsuario()
  {
    $this->logIn("ROLE_SUPER_ADMIN");
    $crawler = $this->client->request('GET','/gl/usuario/nuevo');
    $this->assertSame(Response::HTTP_OK, $this->client->getResponse()->getStatusCode());

    //Creamos usuario
    $form = $crawler->filter('form')->form();
    $form['usuario_form[nombre]']='Perico';
    $form['usuario_form[apellidos]']='Palotes';
    $form['usuario_form[email]']='perico.palotes@galierp.gal';
    $form['usuario_form[plainPassword]']='abc123';
    $form['rol_fiscal']="on";
    $crawler = $this->client->submit($form);

    //Iniciamos SesiÃ³n como el usuario que acabamos de crear
    $this->logOut();
    $crawler = $this->client->request('GET','/gl/login');
    $form = $crawler->filter('.user')->form();
    $form['email']='perico.palotes@galierp.gal';
    $form['password']='abc123';
    $crawler = $this->client->submit($form);

    //Comprobamos accesos
    $crawler = $this->client->request('GET','/gl/clientes');
    $this->assertSame(Response::HTTP_OK, $this->client->getResponse()->getStatusCode());

    $crawler = $this->client->request('GET','/gl/empresas');
    $this->assertSame(Response::HTTP_OK, $this->client->getResponse()->getStatusCode());

    $crawler = $this->client->request('GET','/gl/kanban');
    $this->assertSame(Response::HTTP_FORBIDDEN , $this->client->getResponse()->getStatusCode());

  }

  public function testListaUsuariosProhibido()
  {
    $this->logIn("ROLE_CRM");
    $crawler = $this->client->request('GET','/gl/usuarios');
    $this->assertSame(Response::HTTP_FORBIDDEN, $this->client->getResponse()->getStatusCode());
  }


